struct DataPoints: Identifiable {
  enum Axis2 {
    case lowWater, chunkSize, highWater, connectionLimit
    
    func label() -> String {
      switch self {
      case .lowWater:
        return "low water"
      case .chunkSize:
        return "chunk size"
      case .highWater:
        return "high water"
      case .connectionLimit:
        return "connection limit"
      }
    }
  }
  enum DurationFunction {
    case avg, sum, min, max
    indirect case discardOutliers(Int, DurationFunction)
    
    static func discardOutliers(_ f: DurationFunction) -> DurationFunction {
      return .discardOutliers(1, f)
    }
    
    func combine(_ values: [Double]) -> Double {
      switch self {
      case .avg:
        return values.reduce(0, +) / Double(values.count)
      case .sum:
        return values.reduce(0, +)
      case .min:
        return values.min()!
      case .max:
        return values.max()!
      case .discardOutliers(let c, let f):
        let v2 = Array(values.sorted().dropFirst(c).dropLast(c))
        if v2.isEmpty {
          // If we don't have enough outlyers, just do the normal function...
          return f.combine(values)
        } else {
          return f.combine(v2)
        }
      }
    }
  }
  struct P2: Hashable {
    let x: Int
    let y: Int
    
    func distance(to: P2) -> Double {
      ((Double(self.x - to.x).squared + Double(self.y - to.y).squared)).squareRoot()
    }
  }
  struct ProjectedPoint: Identifiable {
    let p2: P2
    let x: PlottableValue<Int>
    let y: PlottableValue<Int>
    
    // XXX: take duration & duraitonLabel both as arguments, constrcut d internally!
    var d: PlottableValue<Double> {
      return .value(durationLabel, duration)
    }
    let duration: Double
    let durationLabel: String
    var id: String
    var dataPointIds: [String]
    
    internal init(p2: P2, x: PlottableValue<Int>, y: PlottableValue<Int>, duration: Double, durtionLabel: String, dataPointIds: [String]) {
      self.p2 = p2
      self.x = x
      self.y = y
      self.duration = duration
      self.durationLabel = durtionLabel
      self.id = "\(p2.x),\(p2.y)"
      self.dataPointIds = dataPointIds
    }
  }
    
  let lowWater: Int
  let chunkSize: Int
  let highWater: Int
  let connectionLimit: Int
  let durations: [Double]
  var duration: Double {
    guard !durations.isEmpty else {
      return 0
    }
    return durations.reduce(0, +) / Double(durations.count)
  }
  
  var id: String {
    return "\(lowWater)-\(chunkSize)-\(highWater)-\(connectionLimit)"
  }
  
  subscript(_ axis: Axis2) -> Int {
    switch axis {
    case .lowWater:
      return self.lowWater
    case .chunkSize:
      return self.chunkSize
    case .highWater:
      return self.highWater
    case .connectionLimit:
      return connectionLimit
    }
  }
}

extension Array where Element == DataPoints {
  func projected(x: DataPoints.Axis2, y: DataPoints.Axis2, combineSamples: DataPoints.DurationFunction, combineProjection: DataPoints.DurationFunction) -> [DataPoints.ProjectedPoint] {
    var soFar: [DataPoints.P2: [(Double, String)]] = [:]
    for dp in self {
      soFar[DataPoints.P2(x: dp[x], y: dp[y]), default: []].append((combineSamples.combine(dp.durations), dp.id))
    }
    
    let pts =  soFar.map { (key: DataPoints.P2, values: [(Double, String)]) -> DataPoints.ProjectedPoint in
      // XXX: the label "D" should include the DurationFunction maybe?
      let duration = combineSamples.combine(values.map { $0.0 })
      let keys = values.lazy.map({ $0.1 })
      if keys.contains(where: { $0 == "6-57-71"}) {
        let v = values.map { $0.0 }
        let c = combineSamples.combine(v)
        logger.warning("\(keys.map { $0 }): d.combine(\(v))) = \(c)")
      }
      return DataPoints.ProjectedPoint(p2: key, x: .value(x.label(), key.x), y: .value(y.label(), key.y), duration: duration, durtionLabel: "D\(combineSamples)", dataPointIds: values.map { $0.1 })
    }
    return pts
  }
}

extension Array where Element == DataPoints.ProjectedPoint {
  func closest(to p: DataPoints.P2) -> [DataPoints.ProjectedPoint] {
    var soFar: Self = []
    var closetDistance: Double?
    for pp in self {
      let thisD = p.distance(to: pp.p2)
      guard let closetD = closetDistance else {
        closetDistance = thisD
        soFar.append(pp)
        continue
      }
      if thisD < closetD {
        closetDistance = thisD
        soFar = [pp]
      } else if thisD == closetD {
        soFar.append(pp)
      }
    }
    return soFar
  }
}

extension Double {
  var squared: Double {
    self * self
  }
}

private func parse(text: String) -> [DataPoints] {
  let matchDouble = Regex {
    OneOrMore(.digit)
    Optionally {
      "."
      OneOrMore(.digit)
    }
  }
  let parseDoubleArray = Regex {
    TryCapture {
      ZeroOrMore {
        matchDouble
        ","
        ZeroOrMore(" ")
      }
      matchDouble
    } transform: { strÊ¹ -> [Double]? in
      let text = strÊ¹.filter{ !$0.isWhitespace }.components(separatedBy: ",")
      let doubles = text.map { Double($0)! }
      return doubles
    }
  }
  
  let parseLine = Regex {
    TryCapture {
      OneOrMore(.digit)
    } transform: { str -> Int? in
      let v = Int(str)!
      return v
    }
    "-"
    TryCapture {
      OneOrMore(.digit)
    } transform: { str -> Int? in
      let v = Int(str)!
      return v
    }
    "-"
    TryCapture {
      OneOrMore(.digit)
    } transform: { str -> Int? in
      let v = Int(str)!
      return v
    }
    ZeroOrMore {
      "-"
      TryCapture {
        OneOrMore(.digit)
      } transform: { str -> Int? in
        let v = Int(str)!
        return v
      }
    }
    "=["
    parseDoubleArray
    "]\n"
  }
  // XXX consider starting lastRange as startIndex..<startIndex so if line 1 is bad we can get told...
  var lastRange: Range<String.Index>?
  let pts =  text.matches(of: parseLine).compactMap { match -> DataPoints? in
    let m = match.output
    if let last = lastRange, last.upperBound != match.range.lowerBound {
      let nope = text[last.upperBound ..< match.range.lowerBound]
      if !nope.allSatisfy({ $0 == "\n" }) {
        logger.error("Can't match '\(nope)'")
      }
    }
    lastRange = match.range
    guard let connectionLimit = m.4 else {
      // Reject the pre-connectionLimit benchmark data
      return nil
    }
    return DataPoints(lowWater: m.1, chunkSize: m.2, highWater: m.3, connectionLimit: connectionLimit, durations: m.5)
  }
  let expectedCount = text.filter { $0 == "\n" }.count
  let sampleCount = pts.reduce(0) { (acc: Int, sample: DataPoints) -> Int in
    return acc + sample.durations.count
  }
  if pts.count != expectedCount {
    logger.warning("Had \(pts.count) entries (with \(sampleCount) total samples), expected \(expectedCount)")
  } else {
    logger.debug("Have \(pts.count) entries, with \(sampleCount) samples")
  }
  return pts
}

